{"id": 4, "url": "https://www.apartmentfinder.com/California/Riverside-Apartments/Westmont-Village-55-Community-Apartments-beps6p8", "title": "Westmont Village 55+ Community Apartments", "location": "17050 Arnold Dr, Riverside, CA  92518", "rent_special": "", "price_range": "$1,975 - $3,345", "beds": "1 - 3", "bath": "1 - 3", "lease_term": "Contact office for Lease Terms", "assigned_garage_parking_price": "", "assigned_other_parking_price": "", "cat_rent": "", "dog_rent": "", "application_fee": "", "cat_deposit": "", "dog_deposit": "", "apartment_description": "For those seeking a great place to live; this is the perfect place. You belong at Westmont Village\u2019s 150- acreage of rolling hills, with hiking trails and incredible views. It\u2019s a large enough community where residents have privacy, but with a small town feeling so that neighbors know their neighbors. Amenities are aimed at active adults with a zest for life, with a healthy approach to wellbeing.\n\nLeave behind the toils of homeownership and save your cash by living in a stylish and well-appointed cottage within a controlled access gated community, that has restaurant-style dining, a state-of-the-art fitness club and aquatic center along with guest parking. Many homes have stunning views.\n\nYour one-level, single-family home comes with tasteful touches and modern features, many with stainless-steel appliances and granite countertops, and more. Spacious master bedrooms, can accommodate a king-sized bed, have ensuite bathrooms and walk-in closets. Each home has air conditioning, cable, attached garages, washer and dryer hookups, and either a private patio or balcony. Extras such as hardwood floors and crown molding are included in some units. A big bonus is the complimentary building maintenance, and exterior yard and lawn services that are included in your monthly rent. All of this makes it easy to move-in, right now.\n\nWithout the yardwork, you can spend your time exploring nature at many area parks, visiting local cultural museums and art centers, or shopping at nearby centers. Within the community you can have a beer or a glass of wine at the Club House, or visit the Village Caf\u00e9 and Village Shoppe. Join a game of billiards, relax by the pool, attend a fitness class, play pickle ball or hit a round of golf (golf course access is individually paid).  Take time to enjoy the many courtyards, or take your dog to the dog park. There is on-site R.V. parking and storage available on a first come, first served basis (check with lifestyle director for possible fee).\n\nLive close to LA without the hassle of LA traffic. Our community is near Riverside Art Museum, Riverside Metropolitan Museum, UC Riverside Botanic Gardens, Fox Performing Arts Center, California Museum of Photography, March Air Reserve Base, Meridian Business Park, Mount Rubidoux, Canyon Crest Town Center, and much more! The best part of a long day, is to come home to a welcoming neighborhood and a new place to call your forever home.", "office_hour": {"Monday": {"time_open": "12AM", "time_close": "12AM"}, "Tuesday": {"time_open": "12AM", "time_close": "12AM"}, "Wednesday": {"time_open": "12AM", "time_close": "12AM"}, "Thursday": {"time_open": "12AM", "time_close": "12AM"}, "Friday": {"time_open": "12AM", "time_close": "12AM"}, "Saturday": {"time_open": "12AM", "time_close": "12AM"}, "Sunday": {"time_open": "12AM", "time_close": "12AM"}}, "special_features": ["Chapel", "Dog Park", "Educational Classes", "Event & Educational Center", "Hair Salon", "Horseshoe Pits", "Library", "Mail & Shipping Services", "Onsite Health Supervision", "Pickle Ball Courts", "RV Parking", "Theater"], "community_features": ["Community-Wide WiFi", "Laundry Facilities", "Maintenance on site", "Doorman", "24 Hour Access", "Furnished Units Available", "Shuttle to Train", "On-Site ATM", "On-Site Retail", "Hearing Impaired Accessible", "Vision Impaired Accessible", "Trash Pickup - Curbside", "Trash Pickup - Door to Door", "