 University, or going out in downtown Riverside \u2013 all the necessities of life are within reach! Get your groceries at WinCo Foods, less than a mile away! Take in a movie at Regency Theatres TownGate 8. Head to Round1 at the Moreno Valley Mall for a night of bowling, karaoke and games. Or spend a day at TownGate Memorial Park, just up the street. With easy access to the 60, 91 and 215 Highways, \u201cJust Right\u201d Living\u2122 within reach is alive and well in Southern California! \n \nElevate at TownGate is where California charm meets modern living. Minutes away from Riverside and only 60 miles east of Los Angeles, we offer a luxury living experience in a community managed by people who care. This is \u201cJust Right\u201d Living\u2122 within reach in the heart of the Inland Empire! Contact us today to schedule a tour of your new home. We look forward to hearing from you!", "office_hour": {"Monday": {"time_open": "10AM", "time_close": "5PM"}, "Tuesday": {"time_open": "10AM", "time_close": "5PM"}, "Wednesday": {"time_open": "10AM", "time_close": "5PM"}, "Thursday": {"time_open": "10AM", "time_close": "5PM"}, "Friday": {"time_open": "10AM", "time_close": "5PM"}, "Saturday": {"time_open": "10AM", "time_close": "5PM"}, "Sunday": {"time_open": "Closed", "time_close": ""}}, "special_features": ["BBQ / Grill", "Carpet", "Controlled Access", "Courtesy Patrol", "Dining Room", "High Speed Internet Access", "Linen Carpet", "Oven", "Planned Social Activities", "Renters Insurance Program", "Tub / Shower", "Vinyl Flooring"], "community_features": ["Laundry Facilities", "Maintenance on site", "24 Hour Access", "Renters Insurance Program", "Planned Social Activities", "Clubhouse", "Lounge", "Fitness Center", "Spa", "Pool", "Playground", "Tennis Court"], "floorplan_amenities": ["High Speed Internet Access", "Air Conditioning", "Heating", "Ceiling Fans", "Cable Ready", "Tub/Shower", "Dishwasher", "Disposal", "Microwave", "Oven", "Range", "Refrigerator", "Carpet", "Vinyl Floo